svg.script:
webMI.data.subscribe(webMI.query["base"] + ".run_stop", function(e) {
var id = "id_1";
var value = e.value;
if (value == false)
	webMI.gfx.setFill(id, "#ee220c");
if (value == true)
	webMI.gfx.setFill(id, "#61d836");

});webMI.data.subscribe(webMI.query["base"] + ".freq", function(e) {
var id = "id_2";
var value = e.value;
webMI.gfx.setText(id, webMI.sprintf("%.1f", value));

});webMI.data.subscribe(webMI.query["base"] + ".man_auto", function(e) {
var id = "id_7";
var value = e.value;
if (value == false)
	webMI.gfx.setText(id, "T{MAN}");
if (value == true)
	webMI.gfx.setText(id, "T{AUTO}");

});webMI.data.subscribe(webMI.query["base"] + ".loc_rem", function(e) {
var id = "id_3";
var value = e.value;
if (value == false)
	webMI.gfx.setText(id, "T{LOC}");
if (value == true)
	webMI.gfx.setText(id, "T{REM}");

});webMI.data.subscribe(webMI.query["base"] + ".loc_rem", function(e) {
var id = "id_4";
var value = e.value;
if (value == false)
	webMI.gfx.setText(id, "T{LOC}");
if (value == true)
	webMI.gfx.setText(id, "T{REM}");

});
